/**
 * Builds an analyzer with the given stop words.
 *
 *  @param stopwords
 */
public DutchAnalyzer( File stopwords )
{
	stoptable = WordlistLoader.getWordtable( stopwords );
}

/**
 * Builds an analyzer with the given stop words.
 *
 * @param stopwords
 */
public DutchAnalyzer(File stopwords) {
  stoptable = new HashSet(WordlistLoader.getWordtable(stopwords).keySet());
}

